class ContactForm extends React.Component {
  constructor(props) {
    super(props);
  }

render() {
  return(
    <div className="about">
      <form>
        <input />
      </form>
      <style jsx>{`
        .about {
          color: white;
          font-family: 'Cinzel', serif;
          width: 80%;
          font-size: 2em;
          margin-top: 5%;
        }
      `}</style>
    </div>
  )};
}
export default ContactForm
